import React from 'react';
import {Link} from 'react-router-dom';

const Toolbar = () => {
    return (
        <div className="toolbar d-flex align-items-center gap-5">
            <Link to="/gallery">Products page</Link>
            <Link to="/profile">Cart page</Link>
        </div>
    )
}

export default Toolbar;
